-- --------------------------------------------------------

--
-- Struktura tabulky `multiplayer_games`
--

CREATE TABLE `multiplayer_games` (
  `uuid` varchar(256) NOT NULL,
  `code` varchar(6) DEFAULT NULL,
  `type` set('FREEPLAY','RANKED') NOT NULL DEFAULT 'FREEPLAY',
  `round` smallint UNSIGNED NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `player_o` varchar(256) NOT NULL,
  `player_x` varchar(256) NOT NULL,
  `winner` set('X','O') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `state` set('RUNNING','FINISHED') NOT NULL DEFAULT 'RUNNING',
  `board` json DEFAULT NULL,
  `time_played` smallint UNSIGNED NOT NULL DEFAULT '0',
  `winningCells` json DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

--
-- Vypisuji data pro tabulku `multiplayer_games`
--

